import{_ as a,c as t,o as r,d as i}from"./app.9ce347d8.js";const u=JSON.parse('{"title":"DT angiografi","description":"","frontmatter":{},"headers":[{"level":2,"title":"DT angiografi TIA-utredning","slug":"dt-angiografi-tia-utredning"},{"level":2,"title":"DT angiografi halsk\xE4rl","slug":"dt-angiografi-halskarl"},{"level":2,"title":"DT hj\xE4rnangiografi","slug":"dt-hjarnangiografi"},{"level":2,"title":"Fr\xE5gest\xE4llningar","slug":"fragestallningar"}],"relativePath":"dt-angiografi.md","lastUpdated":1666348274000}'),e={name:"dt-angiografi.md"},n=i('<h1 id="dt-angiografi" tabindex="-1">DT angiografi <a class="header-anchor" href="#dt-angiografi" aria-hidden="true">#</a></h1><p>Cerebrovaskul\xE4ra angiografier g\xF6rs med kontrast i art\xE4rfas, till skillnad fr\xE5n <a href="./dt-hjarna-kontrast.html">DT hj\xE4rna med kontrast</a> som g\xF6rs med kontrast i parenkymfas. Det finns olika protokoll p\xE5 S\xF6dersjukhuset: <a href="#dt-angiografi-tia-utredning">DT angiografi TIA-utredning</a>, <a href="#dt-angiografi-halskarl">DT angiografi halsk\xE4rl</a> och <a href="#dt-hjarnangiografi">DT hj\xE4rnangiografi</a>.</p><div class="warning custom-block"><p class="custom-block-title">Indikation</p><p>Exempel:</p><ul><li>Ischemisk stroke</li><li>TIA (utredning av stenos i art\xE4rer)</li><li>Hj\xE4rnaneurysm</li><li>K\xE4rlmissbildning</li></ul></div><div class="tip custom-block"><p class="custom-block-title">Normalfynd</p><p>Ex. Inga plack, stenoser eller ocklusioner. Ingen dissektion eller aneurysm. \xD6ppetst\xE5ende blodk\xE4rl.</p></div><h2 id="dt-angiografi-tia-utredning" tabindex="-1">DT angiografi TIA-utredning <a class="header-anchor" href="#dt-angiografi-tia-utredning" aria-hidden="true">#</a></h2><ul><li>Omfattar omr\xE5det fr\xE5n arcus aorta upp till vertex.</li><li>Indikation stroke- och TIA-utredning i lugnt skede.</li><li>Samma unders\xF6kning ing\xE5r i <a href="./dt-strokelarm.html">DT strokelarm</a>, men skillnaden \xE4r unders\xF6kningens prioritet som \xE4r mer akut vid DT strokelarm.</li></ul><h2 id="dt-angiografi-halskarl" tabindex="-1">DT angiografi halsk\xE4rl <a class="header-anchor" href="#dt-angiografi-halskarl" aria-hidden="true">#</a></h2><ul><li>Omfattar C6-niv\xE5 upp till vertex.</li><li>Indikation patient\xE5lder &lt;45 \xE5r och dissektionsutredning, eftersom ateroskleros \xE4r mycket ovanligt i denna \xE5lderskategori.</li></ul><h2 id="dt-hjarnangiografi" tabindex="-1">DT hj\xE4rnangiografi <a class="header-anchor" href="#dt-hjarnangiografi" aria-hidden="true">#</a></h2><ul><li>Omfattar C2-niv\xE5 upp till vertex.</li><li>L\xE4gst str\xE5ldos.</li><li>Indikation exempelvis aneurysmutredning.</li></ul><h2 id="fragestallningar" tabindex="-1">Fr\xE5gest\xE4llningar <a class="header-anchor" href="#fragestallningar" aria-hidden="true">#</a></h2><div class="info custom-block"><p class="custom-block-title">Exempel</p><ol><li>Stenos?</li><li>Ocklusion?</li><li>Plack?</li><li>Aneurysm?</li><li>K\xE4rlanomali?</li></ol></div><table><thead><tr><th>Fr\xE5gest\xE4llning</th><th>Tillst\xE5nd</th><th>Kommentar</th></tr></thead><tbody><tr><td><b>Stenos?</b></td><td>- Karotisstenos<br>- Basilarisstenos<br>- Intracerebrala art\xE4rer</td><td>Stenosgrad i % anger graden av f\xF6rtr\xE4ngning pga plack/ateroskleros.</td></tr><tr><td><b>Ocklusion?</b></td><td>- Trombos<br>- Emboli<br>- Dissektion</td><td>Vid misstanke om sinustrombos ska dock <a href="./dt-venografi-sinustrombos.html">DT venografi</a> best\xE4llas.</td></tr><tr><td><b>Plack?</b></td><td>- Ateroskleros</td><td><u>Fynd:</u><br>- F\xF6rkalkade plack<br>- Icke-f\xF6rkalkade plack<br>- Mjukt plack</td></tr><tr><td><b>Aneurysm?</b></td><td></td><td>Aneurysm \xE4r oftast intracerebrala.</td></tr><tr><td><b>K\xE4rlanomali?</b></td><td>- AV-missbildning<br>- Arterioven\xF6s fistel</td><td></td></tr></tbody></table>',13),l=[n];function s(d,o,g,h,c,f){return r(),t("div",null,l)}const m=a(e,[["render",s]]);export{u as __pageData,m as default};
